import Nav from './Nav';
import logo from './logo.svg';

function Header(props){
    const styles = {
        width: "50px"
    }
    
    return (
        <header>
            <img src={logo} style={styles}></img>
            <Nav first={props.first} first={props.first}/>
        </header>
    )
}

export default Header;
